import React from 'react';
import 'tachyons';
import img1 from './sharva1.png';
import img2 from './sharva2.png';
import img3 from './sharva3.png';
import img4 from './sharva1.png';

function Gallery() {
  const gal=[
    {
      image:img1,
      height:'450px',
      width:'450px'
    },
    {
      image:img2,
      height:'450px',
      width:'550px'
    }
  ]
    return (
        <section style={{overflow:'hidden'}}>

             <div className="flex flex-wrap mt4">


               <div>
               {
                  gal.map((data)=>{
                    <div>
                      <img src={data.image} />
                    </div>
                  })
                }
               </div>

              </div>

      </section>
      );
}

export default Gallery;

